package com.example.sebastian.tindertp.services;

import android.content.BroadcastReceiver;
import android.content.Context;
import android.content.Intent;
import android.graphics.Bitmap;
import android.util.Log;

import com.example.sebastian.tindertp.ImageTools.ImageBase64;
import com.example.sebastian.tindertp.MatchingActivity;
import com.example.sebastian.tindertp.commonTools.Common;

import org.json.JSONArray;
import org.json.JSONException;
import org.json.JSONObject;

public class JSON_BroadCastReceiver extends BroadcastReceiver {

    private MatchingActivity matchingActivity;

    public JSON_BroadCastReceiver(MatchingActivity matching) {
        matchingActivity = matching;
    }

    @Override
    public void onReceive(Context context, Intent intent) {
        String json = intent.getStringExtra("json");
        Log.i("BROAD", "entra broad");
        if(json != null) {
            try {
                JSONObject jsonO = new JSONObject(json);
                String name = jsonO.getString(Common.USER_NAME);
                String alias = jsonO.getString(Common.USER_ALIAS);
                int age = jsonO.getInt(Common.USER_AGE);
                String sex = jsonO.getString(Common.USER_SEX);
                JSONArray interests = jsonO.getJSONArray(Common.USER_INTERESTS);

                //String photo = jsonO.getString(Common.USER_PHOTO);
                String photo = "";
                Bitmap bitmap = ImageBase64.decodeBase64(photo);

                matchingActivity.setTitle(name + ", " + age + ".");
                matchingActivity.setImage(bitmap,photo);
                matchingActivity.storeToProfile(name, alias, age, sex, interests, bitmap);

            } catch (JSONException e) {
                String photo = "";
                Bitmap bitmap = ImageBase64.decodeBase64(photo);
                matchingActivity.setImage(bitmap,photo);
            }
        }

    }
}
